def convert_track_frame_idx_to_frame_num(track_tuple_list):
    track_tuple_frame_num_list: list = []
    for track_tuple in track_tuple_list:
        node_idx = track_tuple[0]
        frame_num = track_tuple[1] + 1
        prev_node_idx = track_tuple[2]

        track_tuple_frame_num_list.append((node_idx, f"{str(frame_num)}", prev_node_idx))

    return track_tuple_frame_num_list



